import Home from './routes/home/home.component';
import Navigation from './routes/navigation/navigation.component';

const shop = () =>{
  return <h1>"I am the shop page"</h1>
}



const App = () =>{
  return (
    <Routes>
      <Route path='/' element={<Navigation />}>
        <Route index element={<Home />} />
      </Route>
    </Routes>
  );
};

export default App;
